import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import DashboardLayoutNavigationLinks from './components/DashboardPageLayout';
import Login from './pages/Login'; // Asegúrate de tener esta página

function App() {
    return (
        <Router>
            <Routes>
                {/* Ruta para Login */}
                <Route path="/login" element={<Login />} />

                {/* Rutas del dashboard */}
                {/* <Route path="/dashboard/*" element={<DashboardLayoutNavigationLinks />} /> */}

                <Route path="/dashboard" element={<DashboardLayoutNavigationLinks />}>
                    {/* Rutas internas del Dashboard */}
                    <Route path="usuarios" element={<Usuarios />} />
                    <Route path="roles" element={<Roles />} />
                    <Route path="permisos" element={<Permisos />} />
                </Route>

                {/* Redirigir a login si la ruta no existe */}
                <Route path="*" element={<Login />} />
            </Routes>
        </Router>
    );
}

export default App;
